import React from 'react';
import classes from './NavBar.module.css';

const NavBar = () => {
  return (
    <nav className={classes.nav}>
        <div className={classes.item}>
          <a>Profile</a>
        </div>
        <div className={classes.item}>
          <a>Messages</a>
        </div>
        <div className={`${classes.item} ${classes.active}`}>
          <a>News</a>
        </div>
        <div>
          <a>Music</a></div>
        <div><a>Settings</a></div>
      </nav>
  )
}

export default NavBar;
